<template>
    <div class="nav-header">
        <div class="header-content">
            <a class="fl header-logo animated" v-bind:class="{ rubberBand: isActive }" v-on:mouseover="sloganOver" v-on:mouseout="sloganOut" href="javascript:void(0)" v-on:click="sloganClick">
                <img src="data:image/gif;base64,"
                    class="bicycle-gif" />
            </a>
            <ul class="fr menus">
                <li class="menu-item">
                    <a href="/" class="active"> <i class="fa fa-home"></i>
                    </a>
                </li>
                <li class="menu-item">
                    <a href="/categories"> <i class="fa fa-tag"></i>
                    </a>
                </li>
            </ul>
            <div class="site-nav-toggle">
                <button v-on:click="handleShowMenu">
                    <span class="btn-bar"></span>
                    <span class="btn-bar"></span>
                    <span class="btn-bar"></span>
                </button>
            </div>
        </div>
        <div class="menuMask" v-bind:class="{ show: showMenu }">
            <div class="munuList">
                <ul class="menuListUl">
                    <li class="menuItem menuIcon">
                        <a href="/">
                            <div class="am-flexbox am-flexbox-align-middle">
                                <div class="am-flexbox-item">
                                    <i class="fa fa-home"></i>
                                    <span></span>
                                </div>
                                <div class="am-flexbox-item txt-right">
                                    <i class="fa fa-chevron-right"></i>
                                </div>
                            </div>
                        </a>
                    </li>
                    <li class="menuItem menuIcon">
                        <a href="/categories">
                            <div class="am-flexbox am-flexbox-align-middle">
                                <div class="am-flexbox-item">
                                    <i class="fa fa-tag"></i>
                                    <span></span>
                                </div>
                                <div class="am-flexbox-item txt-right">
                                    <i class="fa fa-chevron-right"></i>
                                </div>
                            </div>
                        </a>
                    </li>
                </ul>
            </div>
        </div>
    </div>
</template>
<script>
import utils from "../utils.js";
import particlesJson from "../particlesJson.js";
export default {
    name: 'header',
    data() {
        return {
            showMenu: false,
            isActive: false
        }
    },
    mounted() {
        if (!utils.mobileUA()) {
            setTimeout(() => {
                particlesJS("main", particlesJson.data);
            }, 2000);
        }
    },
    methods: {
        sloganOver() {
            this.isActive = true;
        },
        sloganOut() {
            this.isActive = false;
        },
        sloganClick() {
            this.isActive = this.isActive ? false : true;
        },
        handleShowMenu() {
            this.showMenu = this.showMenu ? false : true;
            if (this.showMenu) {
                utils.addClass(document.body, 'noscroll')
            } else {
                utils.removeClass(document.body, 'noscroll')
            }
        }
    }
}
</script>
